create table pcr_identity
(
    id                 varchar(64)  not null comment '主键ID',
    order_id           varchar(64)  null comment '订单流水号',
    serial_id          varchar(64)  null comment '数据流水号',
    etl_id             varchar(64)  null comment '清洗流水号',
    report_id          varchar(32)  null comment '报告编号',
    gender_code        varchar(60)  null comment '性别',
    birth_datetime     datetime     null comment '出生日期',
    education_code     varchar(60)  null comment '学历',
    degree_code        varchar(60)  null comment '学位',
    employ_status_code varchar(60)  null comment '就业状况',
    email              varchar(64)  null comment '电子邮箱',
    postal_address     varchar(128) null comment '通讯地址',
    country_code       varchar(60)  null comment '国籍',
    perma_address      varchar(128) null comment '户籍地址',
    create_time        datetime     not null comment '入库时间',
    primary key (id, create_time)
)
    comment 'B_01-基本概况信息' engine = InnoDB;

create index idx_etl_report
    on pcr_identity (etl_id, report_id);

